import { useState } from "react";
function Scooter() {
  const [user, setUser] = useState({
    name: "karthick",
    age: 24,
    model: "activa",
    year: "2020",
  });

  return (
    <div>
      <h1>scooter:{user.name}</h1>
      <p>brand:{user.age}</p>
      <p>vehicle {user.model}</p>
      <p>number:{user.year}</p>
      <button onClick={() => setUser({ ...user, age: 34 })}>change</button>
    </div>
  );
}
export default Scooter;
